import React, { Component }  from 'react';

/** @type { React.CSSProperties } */
const HrStyle = {
  margin: 0 + 'px',
  padding: 0 + 'px',
  marginLeft: 1.5 + 'rem',
  marginRight: 1.5 + 'rem',
  width: 'calc(100% - 3rem)',
  borderTop: '2px solid #bbb',
}

const Divider = (props) => <hr style={{ ...HrStyle, ...(props.style ?? {}) }} />;

export { Divider };
